CommentBody:
On Escalation Ticket # 00425751 the new comment has been added: Augustina Sidor:

Please provide the following information by doing the next steps:


	 - 	>> select id, name, IP, serial_number from clientmachine where name =  'MacBook Pro (2)';
	 - 	enable the logs on the two machines with the same name and collect them. 
	 - 	after enabling the logs, try to reregister the machines and also enable the logs on the server  ;

	 - 	vim /EPPServer/sieratool/webservicefree/webservice.php

	 - 	set DEBUG to true and DEBUG_VERBOSITY to 1011 and save the file
	 - 	Reregister the machine

	 - 	select id from clientmachine where name = 'MacBook Pro (2)';   //or replace the machine name with the name of the affected machines
	 - 	UPDATE license SET assigned_to = null where assigned_to IN (id1, id2); ///replace the id1, id2 with the ids resulted from the first query;
	 - 	UPDATE clientmachine SET trialversion = NULL, reregister = 1 WHERE id  IN (id1, id2);

	 - 	DELETE FROM certificate WHERE assigned_to in (id1, id2);
	 - 	Provide the logs from /EPPServer/sieratool/log/WebServiceFree.log

	 - 	Disable the debug enabled at points 2a and 2b;

When filtering after the serial number, please display the Serial Number column using the Show / Hide Columns button. 

Please attach the logs collected from the affected machines to the ticket.


FYI @WaitingOnEngineer

